var lastSound = 0;

function render() {

	var playSound = false;
	lastSound--;

	var ctx = canvas.getContext("2d");
	ctx.clearRect(0, 0, width, height);

	ctx.imageSmoothingEnabled = false;

	pixels.forEach(function(pixel) {

		if (!pixel.burnt) {

			ctx.fillStyle = `rgb(${pixel.color[0]}, ${pixel.color[1]}, ${pixel.color[2]})`;
			ctx.fillRect(pixel.x, pixel.y, 1, 1);

			let dist = pixel.distance(mousePos);
			if (mousedown && dist < 10) {
				pixel.burnSpeed += Math.random() * (10 - dist)/5;
				playSound = true;
			}

			if (pixel.burnSpeed > 0)
				pixel.burn();

		}

	});

	if (playSound && lastSound < 0) {

		const audio = new Audio('fire.mp3');
		audio.play();
		lastSound = 2;

	}
	
	window.requestAnimationFrame(render);

}

window.requestAnimationFrame(render);

var mousedown = false;
window.onmousedown = function(event) { mousedown = true; }
window.onmouseup = function(event) { mousedown = false; }

window.onmousemove = function(event) {

	event = event || window.event;

	mousePos = [event.clientX * width/window.innerWidth, event.clientY * height/window.innerHeight];
	// console.log(`${mousePos[0]}, ${mousePos[1]}`)

}